import React from 'react';
import Header from './header.js';
import { useState, useEffect } from 'react';

function Search_conts({list, word, page, total}) {
    const curList = list.slice(0, 3)
    curList.map((string) => {
        return(    
        <li class="left">
        {
            string.map((str, idx) => {
               return (
                <p>
                {idx === 0 ? (
                str.map((s) => {
                    return(
                        s === word ? (
                            console.log(word)
                        ) : (
                            null
                        )
                    )
                })
                ) : ( null
                )}
                </p>
               )
            })
        }
        </li>
        )
    })
    return (
        <div class="div2">
            <ul>
            {curList.map((string) => {
                return(    
                <li class="left">
                {
                    string.map((str, idx) => {
                       return (
                        <p>
                        {idx === 0 ? (
                        str.map((s) => {
                            return(
                                s === word ? (
                                    <span class = "div2-title bold">{ s }</span>
                                ) : (
                                    <span class = "div2-title">{ s }</span>
                                )
                            )
                        })
                        ) : (
                            idx === 1 && 
                            str.map((s) => {
                                return(
                                    s === word ? (
                                        <span class = "div2-cont bold">{ s }</span>
                                    ) : (
                                        <span class = "div2-cont">{ s }</span>
                                    )
                                    
                                )
                            })
                        )}
                        </p>
                       )
                    })
                }
                </li>
                )
            })}
            </ul>
            {total > 3 && (<button>더보기</button>)}
        </div>
    )
      
}


export default Search_conts;
